import React, { useState, useEffect } from 'react';

interface Product {
    id: number;
    name: string;
    price: number;
    originalPrice: number;
    discount: number;
    image: string;
    category: string;
    inStock: boolean;
}

// Mock products data (moved outside component to avoid dependency issues)
const mockProducts: Product[] = [
  {
    id: 1,
    name: "Multicolor Shawl with handwork",
    price: 4999,
    originalPrice: 8999,
    discount: 50,
    image: "/images/products/product-1.png",
    category: "shawls",
    inStock: true
  },
  {
    id: 2,
    name: "Gift Hamper",
    price: 4999,
    originalPrice: 8999,
    discount: 50,
    image: "/images/products/product-2.png",
    category: "hampers",
    inStock: true
  },
  {
    id: 3,
    name: "Multicolor Shawl with handwork",
    price: 4999,
    originalPrice: 8999,
    discount: 50,
    image: "/images/products/product-3.png",
    category: "shawls",
    inStock: true
  },
  {
    id: 4,
    name: "Gift Hamper",
    price: 4999,
    originalPrice: 8999,
    discount: 50,
    image: "/images/products/product-4.png",
    category: "hampers",
    inStock: true
  },
  {
    id: 5,
    name: "Multicolor Shawl with handwork",
    price: 4999,
    originalPrice: 8999,
    discount: 50,
    image: "/images/products/product-5.png",
    category: "shawls",
    inStock: true
  },
  {
    id: 6,
    name: "Gift Hamper",
    price: 4999,
    originalPrice: 8999,
    discount: 50,
    image: "/images/products/product-6.png",
    category: "hampers",
    inStock: true
  },
];

const FeaturedProducts: React.FC = () => {
  const [products, setProducts] = useState<Product[]>([]);

  useEffect(() => {
    // Simulate API call - in production, this would fetch from backend
    setProducts(mockProducts);
  }, []);

    const formatPrice = (price: number) => {
        return `₹${price.toLocaleString()}`;
    };

    return (
        <section className="py-16 bg-gray-50">
            <div className="container-custom">
                {/* Section Header */}
                <div className="text-center mb-12">
                    <h2 className="text-3xl md:text-4xl font-bold text-dark-900 mb-8">
                        Featured Products
                    </h2>
                </div>

                {/* Products Grid */}
                <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-6">
                    {products.map((product) => (
                        <div
                            key={product.id}
                            className="bg-white rounded-lg overflow-hidden shadow-sm hover:shadow-lg transition-shadow duration-300 group"
                        >
                            {/* Product Image */}
                            <div className="relative aspect-square overflow-hidden">
                                <img
                                    src={product.image}
                                    alt={product.name}
                                    className="w-full h-full object-cover group-hover:scale-105 transition-transform duration-300"
                                />

                                {/* Wishlist Heart */}
                                <button className="absolute top-3 right-3 w-8 h-8 bg-white rounded-full flex items-center justify-center shadow-md hover:bg-gray-50 transition-colors">
                                    <img
                                        src="/images/icons/heart-icon.svg"
                                        alt="Add to wishlist"
                                        className="w-4 h-4"
                                    />
                                </button>

                                {/* Discount Badge */}
                                {product.discount > 0 && (
                                    <div className="absolute top-3 left-3 bg-success-400 text-white px-2 py-1 rounded text-sm font-medium">
                                        ({product.discount}% Off)
                                    </div>
                                )}
                            </div>

                            {/* Product Info */}
                            <div className="p-4">
                                {/* Product Name */}
                                <h3 className="font-semibold text-dark-900 mb-2 line-clamp-2">
                                    {product.name}
                                </h3>

                                {/* Pricing */}
                                <div className="flex items-center justify-between mb-4">
                                    <div>
                                        <div className="flex items-center gap-2">
                                            <span className="text-lg font-bold text-dark-900">
                                                {formatPrice(product.price)}
                                            </span>
                                            {product.originalPrice > product.price && (
                                                <span className="text-sm text-gray-500 line-through">
                                                    {formatPrice(product.originalPrice)}
                                                </span>
                                            )}
                                        </div>
                                        {product.discount > 0 && (
                                            <span className="text-sm text-success-400 font-medium">
                                                ({product.discount}% Off)
                                            </span>
                                        )}
                                    </div>
                                </div>

                                {/* Add to Cart Button */}
                                <button className="w-full bg-dark-900 text-white py-2 px-4 rounded font-medium hover:bg-dark-800 transition-colors duration-200">
                                    Add to Cart
                                </button>
                            </div>
                        </div>
                    ))}
                </div>

                {/* View More Button */}
                <div className="text-center mt-12">
                    <button className="btn-secondary px-8 py-3">
                        View All Products
                    </button>
                </div>
            </div>
        </section>
    );
};

export default FeaturedProducts;
